}

.content {
    &-top {
        background-color: #75bc97;
        height: 500px;
        top: 0;
        display: grid;
        grid-template-columns: repeat(24, 1fr);
        grid-template-rows: 1fr;
        grid-column-gap: 0px;
        grid-row-gap: 0px;

        &__images {
            height: 500px;
            &.plantperson {
