            grid-area: 1 / 9 / 2 / 25;
            z-index: 2;
        }

        &__plant-person {
            margin-top: 36px;
            margin-bottom: 36px;
            grid-area: 1 / 14 / 2 / 23;
        }
    }
    &-options {
        background-color: #ffffff;
        &__items {
            display: flex;
            justify-items: stretch;
            padding-bottom: 53px;
            padding-top: 47px;
            width: 1055px;
            margin: 0 auto;
            justify-content: space-between;
            align-items: flex-end;
        }

        &__select {
            margin-top: 25px;
            border: 1px solid #a8a8a8;
            box-sizing: border-box;
            border-radius: 19px;
            height: 40px;
            width: 219px;
            font-style: normal;
            font-weight: 300;
            font-size: 14px;
            line-height: 27px;
            color: #a8a8a8;
            background-color: #ffffff;
            -webkit-appearance: none;
            -moz-appearance: none;
            appearance: none;
            background: url("images/icons/arrow-down.svg") #ffffff no-repeat 85% !important; /* !important used for overriding all other customisations */
