                font-weight: normal;
                font-size: 16px;
                line-height: 13.5px;
            }
        }

        &__img {
            align-self: center;
        }
    }

    &-results {
        background-color: #f2f2f2;
        display: none;
        padding-top: 37px;
        padding-bottom: 128px;

        &__header {
            width: 1055px;
            margin: 0 auto;
        }
