.photo-grid {
    display: grid;
    align-content: center;
    column-gap: 25px;
    row-gap: 20px;
    grid-template-columns: 3fr 3fr 3fr 3fr;

    &__card {
        background: #ffffff;
        padding: 20px 20px 0 19px;
        border-radius: 5px;
        height: 245px;
        width: 206px;
        left: 0px;
